import ReactDom from "react-dom/client"

const root = ReactDom.createRoot(document.getElementById("root"));

const Home = () => {
    return (
    <>
    <p>
        Home Page
    </p>
    </>   
)
}

const About = () => {
    return (
    <>
    <p>
        About Page
    </p>
    </>   
)
}

const Contact = () => {
    return (
    <>
    <p>
        Contact Page
    </p>
    </>   
)
}

const PathName = window.location.pathname

if(PathName == "/")
    {
        root.render(<Home/>)
    }

else if(PathName == "/about")
    {
        root.render(<About/>)
    } 

    else if(PathName == "/contact")
        {
            root.render(<Contact/>)
        } 

root.render(
    <>
    
    </>
)
